import React from "react";
import { Modal } from "react-bootstrap";
import ModalHeader from "react-bootstrap/ModalHeader";
import "../UserProfileRecipesListStyle.css";
import { faTimes } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const DeleteModal = ({ isModalOpen, closeModal, deleteTask }) => {
  return (
    <Modal show={isModalOpen} onHide={closeModal}>
      <ModalHeader>
        <div style={{ width: "100%", textAlign: "right" }} onClick={closeModal}>
          <FontAwesomeIcon icon={faTimes} />
        </div>
      </ModalHeader>
      <div className="modal_content_holder">
        <p className="modal_body_text">
          Are you sure you want to delete this record?
        </p>
        <div className="btns_holder">
          {" "}
          <button className="cancel" onClick={closeModal}>
            Cancel
          </button>
          <button className="delete" onClick={deleteTask}>
            Delete
          </button>
        </div>
      </div>
    </Modal>
  );
};

export default DeleteModal;
